$_MODULE['<{appagebuilder}prestashop>guide_e758db0a9312eeb625aa94a5529dafd6'] = 'هذه الوحدة توفر وسيلة لتوليد المزيد من موقع قوالب موقع، وتغيير بسرعة موقع الويب الخاص بك، تعرض القائمة المنتج، متعددة الحاجيات مع العديد من ميزة لبيع المحل الخاص بك (الكل في واحد).';
$_MODULE['<{appagebuilder}prestashop>guide_55c3c7f89c0bd6d1cc0bcbb0246cbd4e'] = 'خلق فرص عمل جديدة لمحة';
$_MODULE['<{appagebuilder}prestashop>guide_a27ed6a695aa474957c9a650f9b86904'] = 'يمكنك إنشاء ملامح متعددة، لمحة واحدة فقط، وسيتم تشغيل الافتراضي عندما يتم نشر على شبكة الإنترنت. كل ملف يمكنك تخصيص واجهة لتغيير بشكل مستقل عن بعضها موقع آخر، وجافا سكريبت ورمز المغلق إلى أن تعدل مباشرة هنا ينبغي أن تصبح أكثر مرونة.';
$_MODULE['<{appagebuilder}prestashop>guide_54cb3772ee4512ae0d6f85f846b3a7c7'] = 'كيفية إنشاء شاشة الشخصية الجديدة: من القائمة على اليسار \"ا ف ب إدارة الأوضاع\" إلى الشاشة التالية القوائم الملف الشخصي. انقر على زر \"إضافة + جديد\"';
$_MODULE['<{appagebuilder}prestashop>guide_0b7ccbc45a27df932564e298a1517fe6'] = 'إضافة الحاجيات وحدات جديدة لبناء مواقع ويب في الملف الشخصي.';
$_MODULE['<{appagebuilder}prestashop>guide_1339273fae8c281aebfa708f299d4854'] = 'هذه الوحدة أيضا توفير العديد من الحاجيات لبناء ميزات للمبيعات، بديهية المرونة واجهة المستخدم. أيضا دمج الوحدات الموجودة في هذه الوحدة، تحتاج فقط لبناء موقع بنيت هنا فقط وتصبح أسرع للصفحات.';
$_MODULE['<{appagebuilder}prestashop>guide_47a7f937550e2076b96d3043911dd967'] = 'كيفية إنشاء شاشة الشخصية الجديدة: من القائمة على اليسار \"ا ف ب إدارة الأوضاع\" إلى الشاشة التالية القوائم الملف الشخصي. انقر على زر \"إرسال\" في قائمة التشكيلات الجانبية.';
